 if User.count.zero? 
    puts "Users seeding..."
    number = 0
    values.each do |value|
        number= number+1        
        hospital = Hospital.find_by(code: value['ID_MU'])
        s = value['IDRM'].to_s
        if s.size < 2 
             s = "0"+ s
        end    
        user = User.new(username: value['ID_MU']+'_'+ s, name: value['NAME'], password: '2', hospital: hospital)
        if user.save 
            puts value['ID_MU'], 'seeded'
        else 
            user.errors.full_messages.each { |error| print error, " " } 
            puts ""
        end     
    end    
end 